/*Table structure for table `ms_telisa` */

DROP TABLE IF EXISTS `ms_telisa`;

CREATE TABLE `ms_telisa` (
  `no` int(11) NOT NULL AUTO_INCREMENT,
  `id` varchar(200) NOT NULL,
  `mt_cabang` int(10) unsigned NOT NULL,
  `mt_jenis` int(10) unsigned NOT NULL,
  `mt_nama` varchar(255) NOT NULL,
  `mt_rek` varchar(50) NOT NULL,
  `mt_surat` varchar(50) NOT NULL,
  `mt_alamat` text,
  PRIMARY KEY (`id`),
  KEY `FK_CABANG_MSTELISA` (`mt_cabang`),
  KEY `FK_JENIS_TELISA` (`mt_jenis`),
  KEY `no` (`no`),
  CONSTRAINT `FK_CABANG_MSTELISA` FOREIGN KEY (`mt_cabang`) REFERENCES `dt_cabang` (`id`),
  CONSTRAINT `FK_JENIS_TELISA` FOREIGN KEY (`mt_jenis`) REFERENCES `dt_telisajenis` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8;

